import React from 'react'
import { Link } from 'react-router-dom'
import classNames from 'classnames';
import { SectionTilesProps } from '../../utils/SectionProps';
import SectionHeader from '../sections/partials/SectionHeader';

const SignInPage = (

  topDivider,
  bottomDivider,) => {

  const innerClasses = classNames(
    'features-split-inner section-inner',
    topDivider && 'has-top-divider',
    bottomDivider && 'has-bottom-divider'
  );

  return (
    <div className='container center-content'>
      <div className="tiles-item reveal-from-bottom">
        <form className='form-input-sm'>
            <label className='form-label'>
              E-mail
            </label>
            <input type='text' name='first_name' required />
            <label className='form-label'>
              Password
            </label>
            <input type='password' name='password' required />
        </form>

      <div>
      <button to="login" className="button button-primary button-wide-mobile" type='submit'>Login</button>
      <br />
      <button to="forget-password" className="button button-dark button-wide-mobile button-sm" type='submit'>Forget password?</button>
      </div>
    </div>
    <div>
      <footer className='center-content'>
      <span className="text-color-primary">Create</span> an account.
      </footer>
    </div>
    </div>
      );
};

export default SignInPage;
